import React from "react";
//import PropTypes from "prop-types";

const Stats = props => {
  const allBoardsCompleted = boards => {
    return boards
      ? boards.map(byDate => {
          return (
            <p>
              ${byDate.day}: ${byDate.boardsCompleted}
            </p>
          );
        })
      : "No boards completed!";
  };

  return (
    <div className="stats">
      <p className="student_stats">{props.student.name}</p>
      <div>{allBoardsCompleted(props.student.boardsCompleted)}</div>
    </div>
  );
};

export default Stats;
